-- CREATING A DATABASE FOR A CHURCH
DROP DATABASE IF EXISTS  church_db;
CREATE DATABASE church_db;

USE  church_db;
-- PASTORS TABLE: Stores information about church pastors and their serving status
-- pastor_id - Unique identifier for each pastor (Primary Key)
-- serving_status - Whether the pastor is currently active or inactive
CREATE TABLE PASTORS(
PASTOR_ID  INT AUTO_INCREMENT PRIMARY KEY,
FIRST_NAME VARCHAR(50),
LAST_NAME VARCHAR(50),
GENDER ENUM('MALE', 'FEMALE'),
EMAIL VARCHAR(250),
PHONE_NUMBER  VARCHAR (20),
SERVING_STATUS ENUM('ACTIVE', 'INACTIVE') DEFAULT 'ACTIVE',
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP
);

-- MEMBERS TABLE: Contains records of all church members
-- member_id - Unique identifier for each member (Primary Key)
-- current_status - Tracks if member is active or inactive
-- created_at/updated_at - Automatic timestamps for record tracking
CREATE TABLE MEMBERS(
MEMBER_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
FIRST_NAME VARCHAR(50),
LAST_NAME VARCHAR(50),
EMAIL VARCHAR(250),
PHONE_NUMBER VARCHAR (20),
BIRTH_DATE DATE,
GENDER ENUM('MALE', 'FEMALE'),
CURRENT_STATUS ENUM('ACTIVE', 'INACTIVE') DEFAULT 'ACTIVE',
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP
);

-- TEAMS TABLE: Ministry teams within the church
-- team_id - Unique identifier for each team (Primary Key)
-- leader_id - References member_id from MEMBERS table (Foreign Key)
-- team_name - Name of the ministry team
CREATE TABLE TEAMS(
TEAM_ID  INT AUTO_INCREMENT PRIMARY KEY,
LEADER_ID INT,
TEAM_NAME VARCHAR(50),
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP,
FOREIGN KEY (LEADER_ID) REFERENCES MEMBERS(MEMBER_ID)
);

-- TEAM_MEMBERS TABLE: Junction table for many-to-many relationship between TEAMS and MEMBERS
-- Composite primary key (team_id + member_id)
-- Both fields are foreign keys referencing their respective tables
CREATE TABLE TEAM_MEMBERS(
TEAM_ID INT,
MEMBER_ID INT,
PRIMARY KEY (TEAM_ID, MEMBER_ID),
FOREIGN KEY (TEAM_ID) REFERENCES TEAMS(TEAM_ID),
FOREIGN KEY (MEMBER_ID) REFERENCES MEMBERS(MEMBER_ID)
);

-- E_GROUPS TABLE: Small groups/connect groups in the church
-- group_id - Unique identifier for each group (Primary Key)
-- leader_id - References member_id from MEMBERS table (Foreign Key)
CREATE TABLE E_GROUPS(
GROUP_ID  INT AUTO_INCREMENT PRIMARY KEY,
LEADER_ID INT,
GROUP_NAME VARCHAR(50),
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP,
FOREIGN KEY (LEADER_ID) REFERENCES MEMBERS(MEMBER_ID)
);


CREATE TABLE E_GROUP_MEMBERS(
    GROUP_ID INT,
    MEMBER_ID INT,
    PRIMARY KEY (GROUP_ID, MEMBER_ID),
    FOREIGN KEY (GROUP_ID) REFERENCES  E_GROUPS(GROUP_ID),
    FOREIGN KEY (MEMBER_ID) REFERENCES MEMBERS(MEMBER_ID)
);

-- PROGRAMS TABLE: Special church programs and events
-- program_id - Unique identifier (Primary Key)
-- program_date - When the program occurs
-- program_description - Details about the program
CREATE TABLE PROGRAMS(
PROGRAM_ID  INT AUTO_INCREMENT PRIMARY KEY,
PROGRAM_DATE DATE,
PROGRAM_DESCRIPTION TEXT,
PROGRAM_NAME VARCHAR(50),
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP
);

-- EVENTS TABLE: Specific church events and activities
-- event_id - Unique identifier (Primary Key)
-- organized_by - References pastor_id from PASTORS table (Foreign Key)
-- location - Where the event takes place
CREATE TABLE EVENTS(
EVENT_ID INT AUTO_INCREMENT PRIMARY KEY,
TITLE VARCHAR(100),
DESCRIPTION TEXT,
DATE DATE,
LOCATION VARCHAR(150),
ORGANIZED_BY INT,
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP,
FOREIGN KEY (ORGANIZED_BY) REFERENCES PASTORS(PASTOR_ID)
);

-- ANNOUNCEMENTS TABLE: Church announcements and bulletins
-- announcement_id - Unique identifier (Primary Key)
-- posted_by - References pastor_id from PASTORS table (Foreign Key)
-- posted_at - When the announcement was made
CREATE TABLE ANNOUNCEMENTS(
ANNOUNCEMENT_ID INT AUTO_INCREMENT PRIMARY KEY,
TITLE VARCHAR(100),
MESSAGE TEXT,
POSTED_BY INT,
POSTED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP,
FOREIGN KEY (POSTED_BY) REFERENCES PASTORS(PASTOR_ID)
);

-- SERVICES TABLE: Regular church services and meetings
-- service_id - Unique identifier (Primary Key)
-- pastor_id - References pastor_id from PASTORS table (Foreign Key)
-- program_id - References program_id from PROGRAMS table (Nullable Foreign Key)
CREATE TABLE SERVICES(
SERVICE_ID INT AUTO_INCREMENT PRIMARY KEY,
NAME VARCHAR(100),
DATE DATE,
TIME TIME,
PASTOR_ID INT,
PROGRAM_ID INT,
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP,
FOREIGN KEY (PASTOR_ID) REFERENCES PASTORS(PASTOR_ID),
FOREIGN KEY (PROGRAM_ID) REFERENCES PROGRAMS(PROGRAM_ID)
);

 -- ACCOUNTS TABLE: Financial accounts for church accounting
-- account_number - Unique identifier (Primary Key)
-- account_type - Classification of account (ASSETS, LIABILITIES, etc.)
-- financial_statement - Which financial report the account appears on
CREATE TABLE ACCOUNTS(
ACCOUNT_NUMBER INT AUTO_INCREMENT PRIMARY KEY,
ACCOUNT_DESCRIPTION TEXT,
ACCOUNT_TYPE ENUM ("ASSETS", "LIABILITIES", "EQUITY","EXPENSES" ),
FINANCIAL_STATEMENT ENUM("BALANCE SHEET","INCOME STATEMENT"),
CREATED_AT DATETIME DEFAULT CURRENT_TIMESTAMP,
UPDATED_AT DATETIME ON UPDATE CURRENT_TIMESTAMP
);

